function y = isnumeric(~)
% ISNUMERIC True for pset objects and numeric arrays
%
%   isnumeric(OBJ) returns true if OBJ is a pset object or a numeric array.
%   Otherwise it returns false.
%
% See also: PSET/ISA, PSET/DOUBLE, PSET/SINGLE, PSET/ISFLOAT,
% PSET/ISINTEGER, PSET/ISSPARSE, PSET/ISLOGICAL, PSET/ISCHAR

y = true;


end